<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta
      name="viewport"
      content="width=device-width, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0, user-scalable=0"
    />
    <meta http-equiv="X-UA-Compatible" content="ie=edge" />

    <script src="https://res.wx.qq.com/open/js/jweixin-1.3.2.js"></script>
    <link
      rel="stylesheet"
      href="https://cdn.jsdelivr.net/npm/vant@2.12/lib/index.css"
    />
    <!-- 引入 Vue 和 Vant 的 JS 文件 -->
    <script src="https://cdn.jsdelivr.net/npm/vue@2.6/dist/vue.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/vant@2.12/lib/vant.min.js"></script>
    <title>VR全景展示</title>
    <style>
      #app {
        position: relative;
      }
      .zhuzhuxia {
        position: absolute;
        z-index: 2010;
        width: 100px;
        height: 30px;
        background-color: rgba(00, 00, 00, 0.6);
        line-height: 30px;
        font-size: 14px;
        color: rgba(240, 248, 255, 0.808);
        border-radius: 20px 20px 20px 20px;
        top: 20px;
        text-align: center;
        left: 50%;
        margin-left: -50px;
        transition: width 0.4s linear;
      }

      .down {
        width: 300px;
        left: 50%;
        margin-left: -150px;
        background-color: rgba(00, 00, 00, 0.1);
        color: #fff;
      }
      .iframe {
        position: absolute;
        z-index: -1;
      }
      .swiper {
        /* margin-top: 20px; */
        height: 400px;
        /* width: 80%; */
      }
      .van-overlay {
        background-color: rgba(0, 0, 0, 0);
      }
      .van-popup--center {
        border-radius: 10px;
        top: 45%;
      }
      .my-swipe .van-swipe-item {
      }
      .procut {
        font-size: 14px;
        font-size: rgb(128, 127, 127);
        /* background-color: #000; */
      }
      .dd {
        width: 100%;
        height: 200px;
      }

      .procut .pitem {
        padding: 0 10px;
        height: 40px;
        line-height: 40px;
        border-bottom: 1px solid rgba(0, 0, 0, 0.068);
      }
      .dudua {
        display: flex;
        justify-content: space-between;
        font-size: 11px;
        height: 30px;
        padding: 5px 10px;
        /* border-bottom: 1px solid rgba(0, 0, 0, 0.068); */
      }
      .line {
        margin-top: 5px;
        height: 10px;
        background-color: rgba(204, 204, 204, 0.37);
      }
      .dd231 {
        display: flex;
        justify-content: space-around;
        font-size: 11px;
        line-height: 40px;
        height: 40px;
        border-bottom: 1px solid rgba(0, 0, 0, 0.068);
      }
      .dis {
        margin-top: 5px;
        display: flex;
        height: 50px;
        /* border: 1px solid #f00; */
        align-items: center;
        justify-content: space-between;
      }
      .disicon {
        width: 50%;
        display: flex;
        justify-content: space-around;
      }
      .disbtn {
        width: 110px;
        margin-right: 10px;
        height: 40px;
        text-align: center;
        line-height: 40px;
        font-size: 16px;
        color: #fff;
        border-radius: 5px;
        background-color: rgba(14, 14, 14, 0.89);
      }
    </style>
  </head>
  <body>
    <div id="app">
      <iframe
        src="https://720yun.com/t/db7jrOuftv3#scene_id=27837615"
        frameborder="0"
        class="iframe"
        scrolling="no"
        :style="style"
      >
      </iframe>
      <div class="zhuzhuxia" v-show='zhuzhu1' :class="classObject" @click="dudu">
        云间阁楼<van-icon :name="iconname" />
      </div>
      <!-- 弹出 -->
      <van-popup
        @close="close11"
        :style="{ height: '65%',width:'90%' }"
        closeable
        v-model="show"
      >
        <div class="swiper">
          <van-swipe class="my-swipe" :autoplay="3000" indicator-color="white">
            <van-swipe-item v-for="(image, index) in images" :key="index">
              <img v-lazy="image" class="dd" />
              <!-- <img
              v-if='index==0'
                src="./3.jpg"
                alt=""
                class="dd"
              />
              <img
              v-else
                src="./2.jpg"
                alt=""
                class="dd"
              /> -->
            </van-swipe-item>
          </van-swipe>
          <div class="procut">
            <div class="pitem">云间阁楼</div>
            <div class="pitem">
              <span style="font-size: 11px">(新户型</span> )
              时尚新中式典范范明式家具
            </div>
            <div class="dudua">
              <div>
                杭州市萧山区萧山商会大厦 <br />
                A座501
              </div>
              <div style="line-height: 30px"><van-icon name="phone-o" /></div>
            </div>
            <div class="line"></div>
            <div class="dd231">
              <div>
                <span style="margin-right: 2px"><van-icon name="passed" /></span
                >质量保证
              </div>
              <div>
                <span style="margin-right: 2px"><van-icon name="idcard" /></span
                >售后服务
              </div>
              <div>
                <span style="margin-right: 2px"
                  ><van-icon name="label-o" /></span
                >营业执照
              </div>
            </div>
            <div class="dis">
              <div class="disicon">
                <div style="text-align: center">
                  <div><van-icon name="chat-o" /></div>
                  <div>客服</div>
                </div>
                <div style="text-align: center">
                  <div><van-icon name="star" /></div>
                  <div>已收藏</div>
                </div>
                <div style="text-align: center">
                  <div><van-icon name="share-o" /></div>
                  <div>分享</div>
                </div>
              </div>
              <div class="disbtn">点击咨询</div>
            </div>

            <!-- 
             <van-goods-action>
              <van-goods-action-icon icon="share-o" text="分享" color="#560000" />
            </van-goods-action> -->
          </div>
        </div>
      </van-popup>
    </div>

              : (this.iconname = "arrow-down");
